    visitor_name VARCHAR,
    visit_timestamp TIMESTAMP
);

CREATE TABLE Visitors (
    visitor_id INT PRIMARY KEY,
    visitor_name VARCHAR,
    visit_timestamp TIMESTAMP
);

CREATE TABLE Visitors (
    visitor_id INT PRIMARY KEY,
    visitor_name VARCHAR(50) NOT NULL,
    visit_timestamp TIMESTAMP NOT NULL,
    page_visited VARCHAR(100) NOT NULL
);

CREATE TABLE Pages (
    page_id INT PRIMARY KEY,
    page_name VARCHAR(100) NOT NULL,
    page_category VARCHAR(50) NOT NULL
);

CREATE TABLE Actions (
    action_id INT PRIMARY KEY,
    action_type VARCHAR(50) NOT NULL,
    action_description TEXT
);

CREATE TABLE VisitorActions (
    visitor_id INT,
    action_id INT,
    FOREIGN KEY (visitor_id) REFERENCES Visitors(visitor_id),
    FOREIGN KEY (action_id) REFERENCES Actions(action_id)
);

CREATE TABLE Visitors (
    visitor_id SERIAL PRIMARY KEY,
    visitor_ip VARCHAR(255) NOT NULL,
    visit_timestamp TIMESTAMP NOT NULL,
    page_visited VARCHAR(255) NOT NULL
);

CREATE TABLE Pages (
    page_id SERIAL PRIMARY KEY,
    page_url VARCHAR(255) NOT NULL,
    page_title VARCHAR(255) NOT NULL,
    visit_count INTEGER
);

CREATE TABLE Events (
    event_id SERIAL PRIMARY KEY,
    event_name VARCHAR(255) NOT NULL,
    event_timestamp TIMESTAMP NOT NULL,
    visitor_id INTEGER REFERENCES Visitors(visitor_id)
);

CREATE TABLE Sessions (
    session_id SERIAL PRIMARY KEY,
    session_start TIMESTAMP NOT NULL,
    session_end TIMESTAMP,
    visitor_id INTEGER REFERENCES Visitors(visitor_id)
);

CREATE TABLE Referrers (
    referrer_id SERIAL PRIMARY KEY,
    referrer_url VARCHAR(255) NOT NULL,
    referrer_name VARCHAR(255)
);
